import React, { useEffect } from 'react'
import sellerProfileAction from '../Store/Action/SellerProfileAction'
import { useDispatch, useSelector } from 'react-redux'

const SellerProfile = (props) => {
    console.log(props.id)
    const dispatch = useDispatch()
    // const data = useSelector(state => state.ProductPageReducer?.ProductPageData)
    useEffect(() => {
        sellerProfileAction(dispatch, { sellerId: props.id })
    }, [dispatch])
    const SellerData = useSelector(state => state.SellerProfileReducer.SellerProfileData)
    console.log(SellerData)

    return (
        <>
            {SellerData.map((item) => {
                return (
                    <div>

                        <h4>About The Seller</h4>
                        <img src={item.sellerData[0].sellerImage} alt="seller1234" />
                        <a href="/seller/620c8f991c64873137477700">{item.sellerName}</a>
                        <div className="follow-txt-info">
                            <div className="follow-txt">
                                <span className="total">3</span>
                                <span className="txt" >Followers</span>
                            </div><div className="follow-txt">
                                <span className="total">2</span>
                                <span className="txt" >Following</span>
                            </div>
                        </div>
                        <p>Rating :</p>
                    </div>
                )
            })}
        </>
    )
}

export default SellerProfile
